import { useJwt} from "react-jwt";

import Prodata from "../components/Prodata";

const Profile = () => {


  useEffect(() => {   
    const token = localStorage.getItem("token");
    const mydecodedtoken = useJwt(token);
  }, [])


  return (
    <div className="">
      <Prodata  decodedToken={mydecodedtoken} />
    </div>
  );
};

export default Profile;
